import React from 'react';
import TeamCard from './TeamCard';
// import teams data
import teamsData from './CollegeBasketballTeams.json';


const teams = teamsData.teams

function TeamList() {
  return (
    <div className="team-list">
      {teams.map((team) => (
        <TeamCard
          key={team.id}
          school={team.school}
          mascot={team.mascot}
          city={team.city}
          state={team.state}
        />
      ))}
    </div>
  );
}

export default TeamList;
